function countyList() {
		var state = document.getElementById("myStateCounty").value;
		var cList = document.getElementById("myCounty");
		var counties = Object.keys(allCounties[state]);
		var countyLen = counties.length;
		cList.innerHTML = '';
		for (var i=0;i<countyLen;i++) {
			var para = document.createElement("option");
			para.setAttribute("value", counties[i]);
			para.textContent = counties[i];
			cList.appendChild(para);
		}
}
function sumDistrictsOld(districts){
	var numDistricts = districts.length;
	var resultsTotal = 0;
	var districtTotal = [["Density", "18-29", "30-39", "40-49", "50-59", "60+"]];
	for (var i=1;i<11;i++){
		var oneArray = [i,0,0,0,0,0];
		districtTotal.push(oneArray);
	}
	for (var i=0;i<numDistricts;i++){
		for (var ii=1;ii<11;ii++){
			districtTotal[ii][1]+=districts[i]['data'][ii][1];
			districtTotal[ii][2]+=districts[i]['data'][ii][2];
			districtTotal[ii][3]+=districts[i]['data'][ii][3];
			districtTotal[ii][4]+=districts[i]['data'][ii][4];
			districtTotal[ii][5]+=districts[i]['data'][ii][5];
		}
		resultsTotal += districts[i]['result']/numDistricts;
	}
	return [districtTotal,resultsTotal];
}
function drawChartCounties() {
		var state = document.getElementById("myStateCounty").value;
		var county = document.getElementById("myCounty").value;
		
        //var histoData = sumDistricts([allCounties[state]['01'],allCounties[state]['06']]);
        var histoData = allCounties[state][county].data;
        //document.getElementById('pop_density').innerHTML = histoData[1];

        var dataH = google.visualization.arrayToDataTable(histoData);

		  var options = {
			hAxis: {title: 'Density', logScale: false, viewWindow:{min:0,max:11}},
            vAxis: {title: 'Population', logScale: false},
			isStacked: true,
		  };


        var chartH = new google.visualization.ColumnChart(document.getElementById('histogram_div_counties'));
        
        chartH.draw(dataH,options);
        

}



